data:
  definition: isolateur dont le corps isolant est constitué par deux ou plusieurs
    éléments isolants avec ailette en forme de jupe ou de disque, assembles façon
    permanente entre eux et avec les dispositifs de fixation
  examples: []
  notes:
  - L’isolateur dit multicone est inclus dans cette définition.
